<?php
$module_setting="";
//$module_setting="";
show_module_settings($module_setting);

function show_module_settings($module_setting)
{
	echo "<h1>Module specifications</h1>";
	// From ".setting file"
	$module_setting_serialised = base64_decode( $module_setting );
	$module_setting = unserialize($module_setting_serialised);
	show("module_setting",$module_setting);
	$config_coded = $module_setting['tb_module'][0]->module_config;
	//show("config_coded",$config_coded);
	$config_decoded =strtr( $config_coded , '123456poligamI', 'poligamI123456');
	$config_json = base64_decode( $config_decoded );
	$config = json_decode( $config_json ,true);
	show("module_config",$config);
	echo "<h3>End of Module specifications</h3>";	
}
	
function show($title, $content)
{
    echo "<h2>$title</h2>";
	echo '<pre>';
		print_r($content);
	echo '</pre>';
	echo '<hr>';
}	
?>
